  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "Мультиколлинеарность - явление, при котором наблюдается сильная корреляция между признаками. мультиколлинеарность может стать причиной переобучаемости модели, что приведет к неверному результату. Кроме того, избыточные коэффициенты увеличивают сложность модели машинного обучения, а значит, время ее тренировки возрастает.\n",
    "При построении было учтено то, что нужно использовать только количественные данные, поэтому были оставлены только финансовые показатели и длительность договора. "
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "### Выводы по первому пункту\n",
    "\n",
    "1. были импортированы и соединены 4 таблицы в одну итоговую, data_d итоговая таблица для дальнейшего построения моделей\n",
    "2. был выведен целевой  признак Left - ушел клиент из компании или нет\n",
    "3. был добавилен признак Lifetime - длительность договора с клиентом\n",
    "4. Больше всего клиентов платят ежемесячно в районе 20 ед., также большое количество людей платит 70-90 ед.\n",
    "5. График TotalCharges имеет хвост, уходящий вправо\n",
    "6. Lifetime имеет резкий скачок по количеству до 100 дней и после 2100 дней пользования, то есть существует большая часть клиентов, которые ушли в течение 3 месяцев после оформления договора и тех, кто уже пользуется сервисом более 5.8 лет\n",
    "7. Большинство клиентов использует тип оплаты Month-to-month, больше всего людей использует метод оплаты Electronic check\n",
    "8. Количество дней договора коррелирует напрямую с TotalCharges"
   ]
  },
